import React from 'react';
import { NavLink } from 'react-router-dom/cjs/react-router-dom.min';
import { Form, Input, Button } from 'antd';
import { AuthWrapper } from './style';
import Heading from '../../../../components/heading/heading';

const ResetPass = () => {
    return (
        <AuthWrapper>
            <div className="auth-contents">
                <Form name="forgotPass" layout="vertical">
                    <Heading as="h3">Reset Password?</Heading>
                    <p className="forgot-text">
                        Reset password in two quick steps
                    </p>
                    <Form.Item name="password" label="Enter Password">
                        <Input.Password placeholder="Enter Password" />
                    </Form.Item>

                    <Form.Item name="Conform_password" label="Conform Password">
                        <Input.Password placeholder="Conform Password" />
                    </Form.Item>

                    <Form.Item>
                        <Button className="btn-reset" htmlType="submit" type="primary" size="large">
                            Send Reset Instructions
                        </Button>
                    </Form.Item>
                    <p className="return-text">
                        Return to <NavLink to="/">Sign In</NavLink>
                    </p>
                </Form>
            </div>
        </AuthWrapper>
    );
};

export default ResetPass;
